myApp.controller("themOrderController",function(n,t,i,r,u,f){n.Order={};n.currentIdOrder=f.getParameterByName("idOrder");n.currentIdOrder&&t.get("/API/OrderAPI/"+n.currentIdOrder).success(function(t){n.Order={idOrder:t.idOrder,hoTen:t.hoTen,diaChi:t.diaChi,SDT:t.SDT,email:t.email,tour:t.tour,timeStart:t.timeStart,guestNumber:t.guestNumber}});n.saveOrder=function(){n.currentIdOrder?t.put("/API/OrderAPI/"+n.Order.idOrder,n.Order).success(function(){toastr.success("Thành công","Lưu Order")}).error(function(){toastr.error("Thất bại","Thêm Order")}):t.post("/API/OrderAPI/",n.Order).success(function(){toastr.success("Thành công","Thêm Order");i.location.href="/Admin/Orders"}).error(function(){toastr.error("Thất bại","Thêm Order")})};n.saveOrderAndExit=function(){n.currentIdOrder?t.put("/API/OrderAPI/"+n.Order.idOrder,n.Order).success(function(){i.location.href="/Admin/Orders"}).error(function(){toastr.error("Thất bại","Lưu Order")}):t.post("/API/OrderAPI/",n.Order).success(function(){i.location.href="/Admin/Orders"}).error(function(){toastr.error("Thất bại","Thêm Order")})};n.saveOrderAndNew=function(){n.currentIdOrder?t.put("/API/OrderAPI/"+n.Order.idOrder,n.Order).success(function(){i.location.href="/Admin/Orders/Create"}).error(function(){toastr.error("Thất bại","Lưu Order")}):t.post("/API/OrderAPI/",n.Order).success(function(){i.location.href="/Admin/Orders/Create"}).error(function(){toastr.error("Thất bại","Thêm Order")})};n.cancel=function(){i.location.href="/Admin/Orders"};n.changeTitle=function(){n.Order.alias=Alias.genAlias(n.Order.title)}});